import Head from 'next/head'
import styles from '../styles/Home.module.css'
import Recipe from '../components/recipe'
import { getRecipies, getAllRecipies } from '../lib/api'

export default function Home({recipe, recipies}) {
  // this.props = recipe
  return (
    <div className={styles.container}>
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      { recipies.length > 0 ? recipies.map(
        recipe => (
          <Recipe recipe={recipe.fields.recipe}></Recipe>
        )
      ): null

      }
      </div>
)}

export async function getStaticProps() {
  const recipe = await getRecipies()
  console.log('recipe', recipe);
  const recipies = await getAllRecipies ()

  return {
    props: {recipe, recipies}
  }
}
